data:
  definition: durée de l'intervalle de temps compris entre l'envoi par le poste demandeur
    d'un signal d'appel et la réception du signal de connexion
  examples: []
  notes:
  - C'est la somme du temps de présélection, du temps de numérotation et du temps
    de sélection.
